import React, { Fragment } from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";
import Subcategory from "./Subcategory";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <Fragment>
    <div>{data.map((item) => item.id == id && <p key={id}>{item.description}</p>)}</div>
    <div>
      {data.map((item) => item.id == id && item.datas.map(a => <p>{a.title}</p>))}
    </div>
    </Fragment>
  );
};
